import React from "react";
import { StyleSheet, View, Text, Button,TouchableOpacity } from "react-native";

export default function Register({ navigation }) {
  const characters =
    "ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789";

  const generateString=(length)=> {
    let result = " ";
    const charactersLength = characters.length;
    for (let i = 0; i < length; i++) {
      result += characters.charAt(Math.floor(Math.random() * charactersLength));
    }

    return result;
  }

  const onsubmithandler = () => {
    console.log(generateString(10));
    return;
  };

  return (
    <View style={styles.container}>
      <View style={styles.container1}></View>
      <View style={styles.container2}>
        <Text style={styles.container21}>TRANSACTION COMPLETED</Text>
      </View>
      <View style={styles.container3}>
        <View style={styles.container31}>
          <Text style={styles.container31text}>TRANSACTION COMPLETED</Text>
        </View>
        <View style={styles.container32}>
          <Text style={styles.container32text}>Your chef will come to you</Text>
        </View>
        <View style={styles.container33}>
          <Text style={styles.container33text}>Details</Text>
        </View>
        <View style={styles.container34}>
          <Text style={styles.container34text1}>
            Order Id: 1234
          </Text>
          <Text style={styles.container34text1}>
            diwali
          </Text>
          <Text style={styles.container34text2}>
            address
          </Text>
          <View style={styles.container341}>
            <Text style={styles.container34text2}>
              cusin
            </Text>
            <Text style={styles.container34text2}>dsfg</Text>
            <Text style={styles.container34text2}>
               People
            </Text>
          </View>
          <View style={styles.container341}>
            <Text style={styles.container34text2}>
              date
            </Text>
            <Text style={styles.container34text2}>
              time
            </Text>
          </View>
        </View>
        <View style={styles.container35}>
          <Text style={styles.container33text}>Chef Details</Text>
          <Text>Chef name</Text>
          <Text>Chef address</Text>
        </View>
        <View style={styles.container35}>
          <Text style={styles.container33text}>Payment Details</Text>
          <Text style={styles.container35text}>Amount Paid- Rs. 1000</Text>
        </View>
        <View style={styles.container35}>
          <Text style={styles.container35text}></Text>
          <Text style={styles.container35text}>Pay after the service</Text>
          <Text style={styles.container35text}>
            Remaining amount - Rs. 200
          </Text>
        </View>
        <TouchableOpacity>
          <Text>PAY 2022</Text>
        </TouchableOpacity>
      </View>
    </View>
  );
}
const styles = StyleSheet.create({
  container: {
    flex: 1,
